package today.lqf.leetcode;

import java.util.Arrays;

/**
 * https://leetcode-cn.com/problems/remove-colored-pieces-if-both-neighbors-are-the-same-color/
 *
 */
public class LeetCode2038 {

    /*
     * 超出时间限制
     */
    public boolean winnerOfGameOverTime(String colors) {
        int len = colors.length();
        int[] array = new int[len];
        for (int i = 0; i < len; i++) {
            int n = 0;
            if (colors.charAt(i) == 'A') {
                if (i == 0 || colors.charAt(i - 1) != 'A') {
                    n = 1;
                } else {
                    n = array[i - 1] + 1;
                }
            } else {
                if (i == 0 || colors.charAt(i - 1) != 'B') {
                    n = -1;
                } else {
                    n = array[i - 1] - 1;
                }
            }
            array[i] = n;

        }
        System.out.println(Arrays.toString(array));
        boolean alice = true;
        while (true) {
            boolean flag = true;
            for (int i = len - 1; i >= 2; i--) {
                if (alice) {
                    if (array[i] >= 3) {
                        array[i] = 0;
                        flag = false;
                        break;
                    }
                } else {
                    if (array[i] <= -3) {
                        array[i] = 0;
                        flag = false;
                        break;
                    }
                }
            }

            if (flag)
                break;

            alice = !alice;
        }

        return !alice;
    }

    /*
     * 最终版
     */
    public boolean winnerOfGame(String colors) {
        int len = colors.length();
        int[] array = new int[len];
        int a = 0, b = 0;
        for (int i = 0; i < len; i++) {
            int n = 0;
            if (colors.charAt(i) == 'A') {
                if (i == 0 || colors.charAt(i - 1) != 'A') {
                    n = 1;
                } else {
                    n = array[i - 1] + 1;
                }
                if (n >= 3)
                    a++;
            } else {
                if (i == 0 || colors.charAt(i - 1) != 'B') {
                    n = -1;
                } else {
                    n = array[i - 1] - 1;
                }
                if (n <= -3)
                    b++;
            }
            array[i] = n;

        }
        return a > b;
    }

    public static void main(String[] args) {
//        
        LeetCode2038 obj = new LeetCode2038();
        System.out.println(obj.winnerOfGame("AAABABB"));
        System.out.println(obj.winnerOfGame(
                ""));
        System.out.println(obj.winnerOfGame("ABBBBBBBAAA"));
    }

}
